  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0141106 contains raw underway
  meteorological, navigational, physical and time series data logged by the Scientific
  Computer System (SCS) aboard NOAA Ship Rainier in the Gulf of Alaska from 2014-06-04
  to 2014-06-20. Office of Marine and Aviation Operations (OMAO) personnel aboard
  the ship submitted these data and associated metadata to NODC. In addition, NODC
  Accession 0141106 contains supplementary cruise-level metadata, which OMAO personnel
  logged in the Ship Daily Activity Log (SDAL). OMAO and NODC personnel developed
  the automated process to archive these data under the auspices of the NOAA Rolling
